            'CARACTERÍSTICAS DAS MOLÉCULAS ORG NICAS'+ 'As moléculas orgânicas são formadas por um conjunto de átomos de carbono unidos por ligações covalentes e são divididas de acordo com as suas funções orgânicas, agrupando os compostos com características semelhantes.',
        
        
    }
